import React from 'react';
import '../styles/Style.css';

function Form(props) {
  const HandleSubmit = (e) => {
    e.preventDefault();
    console.log('User submitted.');
  };

  return (
    <div className="wrapper">
      <h1>>{props.symbol}</h1>
      <form onSubmit={HandleSubmit}>
        <fieldset>
          <input
            name={props.name}
            type="text"
            placeholder={props.placeholder}
          />
        </fieldset>
      </form>
    </div>
  );
}

export default Form;
